import { createSlice } from '@reduxjs/toolkit'

const playerSlice = createSlice({
  name: 'player',
  initialState: {
    userInfo: {},
    count: 0,
    status: "pending",
  },
  reducers: {
    age:'xiaoming'
  }
})

export default playerSlice.reducer
